import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import RepairForm from './pages/RepairForm';
import CustomerDashboard from './pages/CustomerDashboard';
import TechnicianDashboard from './pages/TechnicianDashboard';
import ServiceManagerDashboard from './pages/ServiceManagerDashboard';
import FeedbackPage from './pages/FeedbackPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<RepairForm />} />
        <Route path="/customer/:customerId" element={<CustomerDashboard />} />
        <Route path="/technician/:technicianId" element={<TechnicianDashboard />} />
        <Route path="/manager" element={<ServiceManagerDashboard />} />
        <Route path="/feedback/:customerId" element={<FeedbackPage />} />
      </Routes>
    </Router>
  );
}

export default App;
